import React from 'react'
import Fragment from 'render-fragment';

export default class FixedRoster extends React.Component {
    constructor() {
        super();
        this.state = {
            userCourses: [],
            name : ""
        }
    }

    render() {
        return(
            <Fragment>
                {this.props.name}
            </Fragment>

        )
    }
}
